import org.junit.jupiter.api.Test;
import org.apache.commons.pool3.impl.DefaultPooledObject;

import java.util.Arrays;
import java.util.List;

import static org.junit.jupiter.api.Assertions.assertTrue;

public class CapacityHeadroomTest {

    private static class SimpleKeyedPooledObjectFactory extends BaseKeyedPooledObjectFactory {

        public Object create(String key) {
            return new Object();
        }

        public PooledObject<Object> wrap(Object value) {
            return new DefaultPooledObject<>(value);
        }
    }

    private static class WaitingRequestThread extends Thread {
        private final KeyedObjectPool<String, Object> pool;
        private final String category;
        private volatile boolean finished = false;

        public WaitingRequestThread(KeyedObjectPool<String, Object> pool, String category) {
            this.pool = pool;
            this.category = category;
        }

        @Override
        public void run() {
            try {
                pool.borrowObject(category);
                finished = true;
            } catch (Exception e) {
                // Ignore
            }
        }

        public String getCategory() {
            return category;
        }

        public boolean isFinished() {
            return finished;
        }
    }

    @Test
    public void testCapacityHeadroom() throws Exception {
        GenericKeyedObjectPoolConfig config = new GenericKeyedObjectPoolConfig();
        config.setMaxTotalPerKey(6);
        config.setMaxTotal(6);
        config.setMaxWaitMillis(5000L);

        GenericKeyedObjectPool pool = new GenericKeyedObjectPool(new SimpleKeyedPooledObjectFactory(), config);

        List<WaitingRequestThread> waitingRequestThreads = Arrays.asList(
                new WaitingRequestThread(pool, "category1"),
                new WaitingRequestThread(pool, "category2"),
                new WaitingRequestThread(pool, "category2"),
                new WaitingRequestThread(pool, "category3"),
                new WaitingRequestThread(pool, "category3"),
                new WaitingRequestThread(pool, "category3")
        );

        Object[] exhaustedResources1 = {pool.borrowObject("exhaust_cat1"), pool.borrowObject("exhaust_cat1")};
        Object[] exhaustedResources2 = {pool.borrowObject("exhaust_cat2"), pool.borrowObject("exhaust_cat2")};
        Object[] exhaustedResources3 = {pool.borrowObject("exhaust_cat3"), pool.borrowObject("exhaust_cat3")};

        for (WaitingRequestThread thread : waitingRequestThreads) {
            thread.start();
        }

        Thread.sleep(100);

        pool.returnObject("exhaust_cat1", exhaustedResources1[0]);
        pool.returnObject("exhaust_cat1", exhaustedResources1[1]);
        pool.clear("exhaust_cat1");

        Thread.sleep(100); // Give time for a thread to be served
        assertTrue(waitingRequestThreads.stream().anyMatch(t -> "category3".equals(t.getCategory()) && t.isFinished()));

        pool.returnObject("exhaust_cat2", exhaustedResources2[0]);
        pool.returnObject("exhaust_cat2", exhaustedResources2[1]);
        pool.clear("exhaust_cat2");

        Thread.sleep(100); // Give time for more threads to be served
        assertTrue(waitingRequestThreads.stream().filter(WaitingRequestThread::isFinished).count() > 1);

        pool.returnObject("exhaust_cat3", exhaustedResources3[0]);
        pool.returnObject("exhaust_cat3", exhaustedResources3[1]);
        pool.clear("exhaust_cat3");

        for (WaitingRequestThread thread : waitingRequestThreads) {
            thread.join();
        }

        assertTrue(waitingRequestThreads.stream().allMatch(WaitingRequestThread::isFinished));

        pool.close();
    }
}

