public class PoolCapacityLeakTest {

    private static class CustomFactory extends BaseKeyedPooledObjectFactory<String, Object, Exception> {
        private volatile boolean validationResult = false;

        @Override
        public Object create(String key) throws Exception {
            return new Object();
        }

        @Override
        public PooledObject<Object> wrap(Object value) {
            return new DefaultPooledObject<>(value);
        }

        @Override
        public boolean validateObject(String key, PooledObject<Object> p) {
            return validationResult;
        }

        public void setValidationResult(boolean result) {
            this.validationResult = result;
        }
    }

    @Test
    public void testCapacityLeakOnFailedValidation() throws Exception {
        // Step 0: Create a GenericKeyedObjectPoolConfig.
        final GenericKeyedObjectPoolConfig poolConfig = new GenericKeyedObjectPoolConfig();

        // Step 1 & 3: Configure the resource pooling system to validate resources on creation.
        poolConfig.setTestOnCreate(true);

        // Step 2: Set the maximum capacity of the pooling system to two resources.
        poolConfig.setMaxTotal(2);

        // Step 4: Create a factory for the pool that will initially fail all validations.
        final CustomFactory failingValidationFactory = new CustomFactory();

        // Step 5: Create the GenericKeyedObjectPool.
        try (final GenericKeyedObjectPool<String, Object, Exception> pool = new GenericKeyedObjectPool<>(failingValidationFactory, poolConfig)) {

            final String specificCategory = "CATEGORY_A";

            // Step 6 & 7: Attempt to add new resources to the pool for a specific category.
            // These attempts will fail validation and the objects will be destroyed.
            try {
                pool.addObject(specificCategory);
                pool.addObject(specificCategory);
            } catch (final Exception e) {
                // addObject may throw an exception if the factory's create method fails, but in this case
                // validation failure after creation should be handled gracefully by the pool.
            }

            // Step 8 & 9: Verify the system reports zero available resources for the category.
            Assertions.assertEquals(0, pool.getNumIdle(specificCategory));

            // Step 10 & 11: Verify the system reports zero resources in use for the category.
            Assertions.assertEquals(0, pool.getNumActive(specificCategory));

            // Step 12: Reconfigure the validation mechanism to succeed.
            failingValidationFactory.setValidationResult(true);

            // Step 13: Request a resource from the pool for the specific category.
            final Object borrowedResource = pool.borrowObject(specificCategory);

            // Step 14: Verify the system provides a valid, non-null resource.
            Assertions.assertNotNull(borrowedResource);

            // Step 15: Add one more resource to the pool for the specific category.
            pool.addObject(specificCategory);

            // Step 16 & 17: Verify the system shows one resource available for the category.
            Assertions.assertEquals(1, pool.getNumIdle(specificCategory));

            // Step 18 & 19: Verify the system shows one resource checked out for the category.
            Assertions.assertEquals(1, pool.getNumActive(specificCategory));
        }
    }
}

