    }
}

class SimpleFactory<V> implements KeyedPooledObjectFactory<String, V, TestException> {
    private boolean validationEnabled;
    private boolean valid = true;
    private int activeCount;
    private int makeObjectCount;

    @Override
    public void activateObject(final String key, final PooledObject<V> p) throws TestException {
        // Do nothing
    }

    @Override
    public void destroyObject(final String key, final PooledObject<V> p) {
        activeCount--;
    }

    public int getActiveCount() {
        return activeCount;
    }

    public int getMakeObjectCount() {
        return makeObjectCount;
    }

    @Override
    public PooledObject<V> makeObject(final String key) {
        activeCount++;
        makeObjectCount++;
        @SuppressWarnings("unchecked")
        final V obj = (V) (key + String.valueOf(makeObjectCount));
        return new DefaultPooledObject<>(obj);
    }

    @Override
    public void passivateObject(final String key, final PooledObject<V> p) {
        // Do nothing
    }

    public void setValid(final boolean b) {
        this.valid = b;
    }

    public void setValidationEnabled(final boolean b) {
        this.validationEnabled = b;}

    @Override
    public boolean validateObject(final String key, final PooledObject<V> p) {
        if (validationEnabled) {
            return valid;
        }
        return true;
    }
}

